import React, { useEffect, useState, useHistory } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import login from "./components/login";
const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Switch>
          <Route exact path="/">
            <login />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
};

export default App;
